import React from "react";
import { useParams } from "react-router";

function CampaignDetail(props) {
  const { id } = useParams();
  return (
    <div>
      <div className="image">{id}</div>
      <div className="title">Test</div>
    </div>
  );
}

export default CampaignDetail;
